import React from "react";
import styled from 'styled-components';

const TwojaStara = styled.div`
    background-color: aliceblue;
    width: 1200px;
    height: 1200px;
`;

const Card = () => {
    return <TwojaStara>
        <h2>Meme</h2>
    </TwojaStara>;
}

export default Card;
